import React, { useEffect, useState } from "react";
import axios from "axios";
import { Card, CardContent } from "@/components/ui/card";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";

export default function AdminDashboard({ auth }) {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const res = await axios.get("http://localhost:5000/api/admin/stats", {
          headers: {
            Authorization: `Bearer ${auth?.token}`, // send JWT
          },
        });
        setStats(res.data);
      } catch (err) {
        console.error("Failed to fetch stats", err);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, [auth]);

  if (loading) return <p className="text-center mt-10">Loading admin stats...</p>;
  if (!stats) return <p className="text-center mt-10 text-red-500">Failed to load stats</p>;

  const chartData = [
    { name: "Uploads", value: stats.total_uploads },
    { name: "Logins", value: stats.total_signins },
    { name: "Signups", value: stats.total_signups },
    { name: "Downloads", value: stats.total_downloads },
    { name: "Users", value: stats.total_users },
  ];

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>

      {/* Summary Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-10">
        <Card className="shadow-lg rounded-2xl">
          <CardContent className="p-6 text-center">
            <h2 className="text-xl font-semibold">Total Users</h2>
            <p className="text-2xl mt-2">{stats.total_users}</p>
          </CardContent>
        </Card>
        <Card className="shadow-lg rounded-2xl">
          <CardContent className="p-6 text-center">
            <h2 className="text-xl font-semibold">PDF Uploads</h2>
            <p className="text-2xl mt-2">{stats.total_uploads}</p>
          </CardContent>
        </Card>
        <Card className="shadow-lg rounded-2xl">
          <CardContent className="p-6 text-center">
            <h2 className="text-xl font-semibold">Logins</h2>
            <p className="text-2xl mt-2">{stats.total_signins}</p>
          </CardContent>
        </Card>
        <Card className="shadow-lg rounded-2xl">
          <CardContent className="p-6 text-center">
            <h2 className="text-xl font-semibold">Signups</h2>
            <p className="text-2xl mt-2">{stats.total_signups}</p>
          </CardContent>
        </Card>
        <Card className="shadow-lg rounded-2xl">
          <CardContent className="p-6 text-center">
            <h2 className="text-xl font-semibold">Downloads</h2>
            <p className="text-2xl mt-2">{stats.total_downloads}</p>
          </CardContent>
        </Card>
      </div>

      {/* Bar Chart */}
      <div className="bg-white shadow-lg rounded-2xl p-6">
        <h2 className="text-2xl font-bold mb-4">Activity Overview</h2>
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={chartData}>
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="value" fill="#4F46E5" radius={[6, 6, 0, 0]} />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}
